Category	All Sex, Cheerleaders

Director	Jim Malibu
Starring	Tommy Gunn, Randy Spears, Kayden Kross, Gracie Glam, Alan Stafford, Kris Slater, Amia Miley, Alexis Ford, Nicole Ray, Addison Cain

Kayden Kross is in it to win it after starting an exclusive Cheerleaders Academy. Her plan is to go big, and in order to achieve her dreams she'll need to fill herself up with more than just team spirit! New contract girl Alexis Ford plays the cheerleading coach, and she shows the new girls a booty shaking routine that gets them all going for it!

